import tensorflow as tf
# from tensorflow.keras.optimizers import Adam
from tensorflow.keras.layers import Conv2D, Conv1D, BatchNormalization, UpSampling2D, Concatenate, ReLU, LSTM, Dense, Reshape

def Conv_BiLSTM2(name, input_):

    shape = input_.shape
    inputs = tf.keras.Input(shape=input_[0].shape, name="inputs")

    cnn1 = Conv1D(3, 2, use_bias=True)(inputs)  # Filter 3 , kernel = 2 , lapisan ini menggunakan bias (nilai tambahan yang diguanakan untukm menyesuaikan output)
    cnn2 = Conv1D(3, 2, use_bias=True)(cnn1)

    bilstm = tf.keras.layers.Bidirectional(LSTM(256, return_sequences=True),  merge_mode='concat', weights=None, backward_layer=None)(cnn2) # gabungan (concat) backward dan forward bilstm = merge_mode
    bilstm = tf.keras.layers.Bidirectional(LSTM(256), merge_mode='concat', weights=None, backward_layer=None,)(bilstm)

    # print(lstm.shape)

    # Attention Model
    flat_cnn = tf.keras.layers.Flatten()(cnn2)
    flat_lstm = tf.keras.layers.Flatten()(bilstm)
    concated =  tf.keras.layers.Concatenate(axis=1)([flat_cnn, flat_lstm])

    # print(concated.shape)
    tanh = tf.keras.activations.tanh(concated)            # membuat nilai berada pada rentang -1 dan 1
    Norm = tf.keras.layers.Normalization(axis=None)(tanh) # melakukan proses normalisasi data

    concated_2 =  tf.keras.layers.Concatenate(axis=1)([Norm, flat_lstm])
    # print(concated_2.shape)

    return tf.keras.Model(inputs=[inputs], outputs=concated_2, name=name)

"""# **Conv_BiLSTM_Attention**"""

from tensorflow.keras.layers import Layer

class AttentionLayer(tf.keras.layers.Layer):
    def __init__(self, units):                             # unit = number of unit in dense layer
        super(AttentionLayer, self).__init__()
        self.W1 = tf.keras.layers.Dense(units)             # dense for query layer
        self.W2 = tf.keras.layers.Dense(units)             # dense for key layer
        self.V = tf.keras.layers.Dense(1)                  # dense for value layer

    def call(self, query, values):
        query_with_time_axis = tf.expand_dims(query, 1)                               # menambah dimensi waktu ke query sehingga bisa dijumlahakan dengan value
        score = self.V(tf.nn.tanh(self.W1(query_with_time_axis) + self.W2(values)))   # menghitung score attention (query + key)
        attention_weights = tf.nn.softmax(score, axis=1)                              # menghitung bobot attenion dengan softmax (jumlah keseluruhan = 1)
        context_vector = attention_weights * values                                   # menghitung vektor konteks sebagai produk elemen (value)
        context_vector = tf.reduce_sum(context_vector, axis=1)                        # menjumlahkan vektor konteks sepanjang dimensi waktu untuk mendapatkan vektor konteks akhir
        return context_vector, attention_weights                                      # mengembalikan vektor konteks dan bobot atensi

import tensorflow as tf
# from tensorflow.keras.optimizers import Adam
from tensorflow.keras.layers import Conv2D, Conv1D, BatchNormalization, UpSampling2D, Concatenate, ReLU, LSTM, Dense, Reshape, Attention

def Conv_BiLSTM2_Attention(name, input_):

    shape = input_.shape
    inputs = tf.keras.Input(shape=input_[0].shape, name="inputs")

    cnn1 = Conv1D(32, 3, use_bias=True)(inputs)
    cnn2 = Conv1D(32, 3, use_bias=True)(cnn1)

    bilstm = tf.keras.layers.Bidirectional(LSTM(512, return_sequences=True),  merge_mode='concat', weights=None, backward_layer=None)(cnn2) # gabungan backward dan forward bilstm = merge_mode
    bilstm = tf.keras.layers.Bidirectional(LSTM(512), merge_mode='concat', weights=None, backward_layer=None,)(bilstm)

    # print(lstm.shape)

    flat_cnn = tf.keras.layers.Flatten()(cnn2)
    flat_lstm = tf.keras.layers.Flatten()(bilstm)
    concated =  tf.keras.layers.Concatenate(axis=1)([flat_cnn, flat_lstm])

    # Attention Model
    tanh = tf.keras.activations.tanh(concated)                     # tracking the non-linearites and make gradien pelatihan seimbang
    Norm = tf.keras.layers.Normalization(axis=None)(tanh)          # menjaga skala nilai tetap sama,  menyederhanakan proses optimasi solusi

    concated_2 =  tf.keras.layers.Concatenate(axis=1)([Norm, flat_lstm])

    context_vector, attention_weights = AttentionLayer(32)(concated_2, concated_2)

    return tf.keras.Model(inputs=[inputs], outputs=context_vector, name=name)

