def Proposed2(name, input_, output_size, name_model):
    inputs_hour = tf.keras.Input(shape=input_[0].shape, name="inputs_hour")
    inputs_day = tf.keras.Input(shape=(24, 4), name="inputs_day")
    inputs_week = tf.keras.Input(shape=(24, 4), name="inputs_week")
    inputs_month = tf.keras.Input(shape=(24, 4), name="inputs_month")

    if name_model == 'conv_lstm':
        layer_1 = Conv_LSTM2("Conv_LSTM", input_)(inputs_hour)
    elif name_model == 'conv_bilstm':
        layer_1 = Conv_BiLSTM2("Conv_BiLSTM", input_)(inputs_hour)
    elif name_model == 'cnn_lstm':
        layer_1 = CNN_LSTM2("cnn_LSTM", input_)(inputs_hour)
    else:
        layer_1 = CNN_BiLSTM2("CNN_BiLSTM", input_)(inputs_hour)

    bilstm1 = tf.keras.layers.Bidirectional(LSTM(256, return_sequences=True))(inputs_day)
    concated_bilstm1 = Concatenate(axis=1)([bilstm1, bilstm1])
    attention_1 = AttentionLayer(32)
    context_vector_1, attention_weights_1 = attention_1(concated_bilstm1[:, -1, :], concated_bilstm1)

    bilstm2 = tf.keras.layers.Bidirectional(LSTM(256, return_sequences=True))(inputs_week)
    concated_bilstm2 = Concatenate(axis=1)([bilstm2, bilstm2])
    attention_2 = AttentionLayer(32)
    context_vector_2, attention_weights_2 = attention_2(concated_bilstm2[:, -1, :], concated_bilstm2)

    bilstm3 = tf.keras.layers.Bidirectional(LSTM(256, return_sequences=True))(inputs_month)
    concated_bilstm3 = Concatenate(axis=1)([bilstm3, bilstm3])
    attention_3 = AttentionLayer(32)
    context_vector_3, attention_weights_3 = attention_3(concated_bilstm3[:, -1, :], concated_bilstm3)

    combined_context_vector = Concatenate()([context_vector_1, context_vector_2, context_vector_3])
    concated_2 = Concatenate(axis=1)([layer_1, combined_context_vector])

    flat = Flatten()(concated_2)
    FF = Dense(512, activation="sigmoid")(flat)
    FC = Dense(512, activation="sigmoid")(FF)
    Output = Dense(output_size, activation="sigmoid")(FC)

    return Model(inputs=[inputs_hour, inputs_day, inputs_week, inputs_month], outputs=Output, name=name)

